You might be wondering whether there is a runtime cost when using generic type parameters. The good news is that using generic types won‚Äôt make your program run any slower than it would with concrete types. Rust accomplishes this by performing monomorphization of the code using generics at compile time. Monomorphization is the process of turning generic code into specific code by filling in the concrete types that are used when compiled. In this process, the compiler does the opposite of the steps we used to create the generic function in Listing 10-5: the compiler looks at all the places where generic code is called and generates code for the concrete types the generic code is called with. Let‚Äôs look at how this works by using the standard library‚Äôs generic Option<T> enum: let integer = Some(5);
